        keyFlags = keyFlags | 1
    else if( e.keyCode == 17 )

}

function keyUp(e) {
    if( is.ie ) e = event
    if( e.keyCode == 18 )
        keyFlags = keyFlags & ~1
    else if( e.keyCode == 17 )
        keyFlags = keyFlags & ~2
    else if( e.keyCode == 16 )
        keyFlags = keyFlags & ~4
}

text766949.addInnerText('<div id=\"text766949\"><a id=\"text766949anc\" tabindex=\"136\"style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text766949Font1\" style=\"position:relative;top:-2px;\" >Selective laser sintering (SLS) and Multi Jet Fusion (MJF) &nbsp;</span ><span class=\"text766949Font2\" style=\"background-color:transparentposition:relative;top:-2px;\" >\n</span ></p >\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text766949Font2\" style=\"position:relative;top:-2px;\" >Support structures are </span ><span class=\"text766949Font1\" style=\"position:relative;top:-2px;\" >not required.</span ><span class=\"text766949Font2\" style=\"position:relative;top:-2px;\" > The tightly packed unfused powder in the bed supports the solid part as it is being built. This allows parts to be stacked, allowing the build chamber to be packed with multiple parts and increasing the part output per build.\n</span ></p >\n</div>\n');

text769211.addInnerText('<div id=\"text769211\"><a id=\"text769211anc\" tabindex=\"137\"style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text769211Font1\" style=\"position:relative;top:-2px;\" >Selective laser melting (SLM) &nbsp;\n</span ></p >\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text769211Font2\" style=\"position:relative;top:-2px;\" >Support structures are </span ><span class=\"text769211Font1\" style=\"position:relative;top:-2px;\" >required </span ><span class=\"text769211Font2\" style=\"position:relative;top:-2px;\" >for overhanging geometries. Since only one material can be in the powder bed at a time, the support material will be the same as the part. Metal support structures often require tools to remove them. </span ><span class=\"text769211Font1\" style=\"background-color:transparentposition:relative;top:-2px;\" >\n</span ></p >\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text769211Font1\" style=\"background-color:transparentposition:relative;top:-2px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text769211Font1\" style=\"position:relative;top:-2px;\" >Electron beam melting (EBM) &nbsp;\n</span ></p >\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text769211Font2\" style=\"position:relative;top:-2px;\" >Support structures are </span ><span class=\"text769211Font1\" style=\"position:relative;top:-2px;\" >not required.</span ><span class=\"text769211Font2\" style=\"position:relative;top:-2px;\" > The tightly packed unfused powder in the bed supports the solid part as it is being built, allowing parts to be stacked on top of one another.\n</span ></p >\n</div>\n');
text769211.build()
